<template>
    <div id="ballplacement"></div>
</template>

<script>
import {mapGetters} from 'vuex'
import Plotly from 'plotly.js'

export default {
  data () {
    return {
      plotData: null,
      layoutR: null,
      layoutL: null
    }
  },
  computed: {
    ...mapGetters({
      trackingData: 'trackingData',
      sessionStats: 'sessionStats',
      releaseData: 'releaseData',
      routeData: 'routeData'
    })
  },
  watch: {
    routeData: {
      handler (val) {
        this.plotData = null
        this.fill()
        let data = this.routeData
        if (data['Ball Placement Image'].dir === 'R') {
          Plotly.react('ballplacement', this.plotData, this.layoutR)
        } else {
          Plotly.react('ballplacement', this.plotData, this.layoutL)
        }
      },
      deep: true
    }
  },
  methods: {
    fill () {
      let data = this.routeData
      // create rings data
      let ix = []
      let iy = []
      let ox = []
      let oy = []
      for (let d = 0; d < 361; d++) {
        // inner ring
        ix.push(data['Ball Placement Image'].aimpt.x + 0.5 * Math.cos(d * (Math.PI / 180)))
        iy.push(data['Ball Placement Image'].aimpt.y + 0.5 * Math.sin(d * (Math.PI / 180)))
        // outer ring
        ox.push(data['Ball Placement Image'].aimpt.x + 1 * Math.cos(d * (Math.PI / 180)))
        oy.push(data['Ball Placement Image'].aimpt.y + 1 * Math.sin(d * (Math.PI / 180)))
      }
      var ball = {
        x: [-data['Ball Placement Image'].ball.x],
        y: [data['Ball Placement Image'].ball.y],
        type: 'scatter',
        xaxis: 'x',
        yaxis: 'y',
        marker: {
          color: '#000000'
        }
      }
      // place rings onto plot
      var inner = {
        x: ix,
        y: iy,
        xaxis: 'x',
        yaxis: 'y',
        line: {
          color: '#018710',
          layer: 'above'
        }
      }
      var outer = {
        x: ox,
        y: oy,
        xaxis: 'x',
        yaxis: 'y',
        line: {
          color: '#E6DE01'
        }
      }

      let layoutL = {
        hovermode: false,
        showlegend: false,
        yaxis: { showgrid: false, range: [0, 3], scaleanchor: 'x', scaleratio: 1, showticklabels: false },
        // yaxis2: { showgrid: false, rangemode: "tozero", scaleanchor: "x2", scaleratio: 1, showticklabels: false},
        xaxis: { showgrid: false, zeroline: false, autorange: "reversed", scaleratio: 1 },
        // xaxis2: { showgrid: false, zeroline: false, autorange: "reversed" },
        images: [{
          x: -data['Ball Placement Image'].rec.xmin,
          y: data['Ball Placement Image'].rec.ymin,
          sizex: data['Ball Placement Image'].rec.xmax - data['Ball Placement Image'].rec.xmin,
          sizey: data['Ball Placement Image'].rec.ymax - data['Ball Placement Image'].rec.ymin,
          xref: 'x',
          yref: 'y',
          xanchor: 'left',
          yanchor: 'bottom',
          layer: 'below',
          source: 'data:image/png;base64,'
        }]
      }
      let layoutR = {
        hovermode: false,
        showlegend: false,
        yaxis: {
          showgrid: false,
          range: [0, 2.5],
          scaleanchor: 'x',
          scaleratio: 1,
          showticklabels: false
        },
        xaxis: {
          // range: [-data["Ball Placement Image"].rec.xmin - 5, data["Ball Placement Image"].rec.ymin + 5],
          // autorange: "reversed",
          showgrid: false,
          zeroline: false },
        images: [{
          x: -data['Ball Placement Image'].rec.xmin,
          y: data['Ball Placement Image'].rec.ymin,
          sizex: data['Ball Placement Image'].rec.xmax - data['Ball Placement Image'].rec.xmin,
          sizey: data['Ball Placement Image'].rec.ymax - data['Ball Placement Image'].rec.ymin,
          xref: 'x',
          yref: 'y',
          xanchor: 'right',
          yanchor: 'bottom',
          layer: 'below',
          source: 'data:image/png;base64,'
        }]
      }
      this.plotData = [inner, outer, ball]
      this.layoutR = layoutR
      this.layoutL = layoutL
      if (data['Ball Placement Image'].dir === 'R') {
        Plotly.newPlot('ballplacement', [inner, outer, ball], layoutR)
      } else {
        Plotly.newPlot('ballplacement', [inner, outer, ball], layoutL)
      }
      window.onresize = function () {
        Plotly.Plots.resize('plotter')
      }
    }
  },
  mounted () {
    this.fill()
  }
}
</script>
